    //     'monstera',
    //     'ficus lyrata',
    //     'pothos argenté',
    //     'yucca',
    //     'palmier'
    // ]
    const reducer = (acc, plant) => {
        acc.includes(plant.category) ? acc : acc.concat(plant)
    }
    return (
        <ul>
            {plantList.reduce(reducer, [])}
        </ul>
    )
}

export default Test
